import React from 'react';
import {Button, Container, Form, Nav, Navbar, Link} from "react-bootstrap";

import logo from './logo.png'
import {BrowserRouter, Switch, Route} from "react-router-dom";
import Home from "../Pages/Home";
import Dokumenty from "../Pages/Dokumenty";
import Towary from "../Pages/Towary";
import Magazyny from "../Pages/Magazyny";
import Firmy from "../Pages/Firmy";

class Header extends React.Component{
    render() {
        return(
            <>
            <Navbar fixed="top" collapseOnSelect expand="md" bg="dark" variant="dark" >
                <Container >
                    <Navbar.Brand href="/">
                        <img
                            src={logo}
                            height="32"
                            width="32"
                            className="d-inline-block align-top"
                            alt="logo"
                        /> Magazyn
                    </Navbar.Brand>
                    <Navbar.Toggle aria-controls="responsive-navbar-nav"/>
                    <Navbar.Collapse id="responsive-navbar-nav">
                        <Nav className="mr-auto">
                            <Nav.Link href="/dokumenty">Dokumenty</Nav.Link>
                            <Nav.Link href="/towary">Towary</Nav.Link>
                            <Nav.Link href="/magazyny">Magazyny</Nav.Link>
                            <Nav.Link href="/firmy">Firmy</Nav.Link>
                        </Nav>
                        <Form inline>
                            <Button variant="outline-info" href="/logowanie">Logowanie</Button>
                        </Form>
                    </Navbar.Collapse>
                </Container>
            </Navbar>
             <BrowserRouter>
                 <Switch>
                     <Route exact path="/" component={Home} />
                     <Route exact path="/dokumenty" component={Dokumenty} />
                     <Route exact path="/towary" component={Towary} />
                     <Route exact path="/magazyny" component={Magazyny} />
                     <Route exact path="/firmy" component={Firmy} />
                 </Switch>
            </BrowserRouter>
            </>
        )
    }
}
export default Header;
